import React from "react";
function card(source){
   return(<div className="cards">
        <div className="card">
            <img style={{width:'300px',height:'300px'}} className="img" alt="swaminarayan photo" src={source.img}></img>
            <div className="cardinfo">
                <span className="cardcategory">{source.span}</span>
                <h3 className="cardtitle">{source.title}</h3>
                <a href={source.ankar}>
                    <button>watch now</button>
                </a>
            </div>
        </div>
    </div>);
}
// https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSp8pqJ8cY807dGS5J1lXOtG6R6W-lMWE5RaA&usqp=CAU

// https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRATx04jdhk8dp1e9VeTzQpEUQ1A5OBQcLWZQ&usqp=CAU
export default card;
